# Find the Reverse Complement of a String

def reverse_strand(str):
    _str = ""
    for i in range(len(str)):
        base = str[i]
        if base == "A":
            _str = "T" + _str
        elif base == "T":
            _str = "A" + _str
        elif base == "G":
            _str = "C" + _str
        elif base == "C":
            _str = "G" + _str
    return _str

str = ""
_str = reverse_strand(str)
